    useEffect(() => {
        fetch("http://localhost:5000/api/id")
        .then(response => response.json())
        .then(data => console.log(data))
    }, [])
        
    return (
        <div>
            <h3>Id: {person.id}</h3>
            <h3>Name: {person.Name}</h3>
            <h3>Age: {person.Age}</h3>
            <h3>Salary: {person.Salary}</h3>
        </div>
    );
}

